import React, { useState, useRef } from "react";
import TopNavBar from "../../components/TopNavBar/TopNavBar";
import styles from "./LandingPage.module.css";
import { ButtonContentData, carouselDataContent1, Logos } from "./data";
import {
	HEADER_CONTENT,
	LEADING_ORGANIZATIONS_TITLE,
	PARAGRAPH_CONTENT,
	HEADER_CONTENT_4,
} from "../../utils/cms";
import image1 from "../../assets/images/image1.png";
import SignUpForm from "../SignUpFormik/SignUpForm";
import Footer from "../../components/Footer/Footer";
import "./slick.css";
import "./slick-theme.css";
import bgImage from "../../assets/images/carouselbg.png";
import Slider from "react-slick";
import Features from "../Features/Features";
import Tools from "../Tools/Tools";
import Pricing from "../Pricing/Pricing";
import Carousel from "react-grid-carousel";

function LandingPage() {
	const settings = {
		dots: true,
		infinite: true,
		arrow: true,
		speed: 800,
		slidesToShow: 1,
		slidesToScroll: 1,
	};
	const [hovered, setHovered] = useState(false);

	const handleMouseEnter = () => {
		setHovered(true);
	};

	const handleMouseLeave = () => {
		setHovered(false);
	};

	return (
		<>
			<TopNavBar />

			<div className={styles.pageContainer}>
				<div className={styles.bodyContent}>
					<div className={styles.headerContent}>
						{HEADER_CONTENT}
					</div>
					<div className={styles.paragraphContent}>
						{PARAGRAPH_CONTENT}
					</div>
					<div className={styles.button}>
						{ButtonContentData.map((ele, i) => {
							return (
								<a
									href={ele.path}
									className={
										ele.type === "button1"
											? styles.buttonText1
											: styles.buttonText2
									}
								>
									{ele.name}
								</a>
							);
						})}
					</div>
				</div>

				<div className={styles.imageSection}>
					<img src={image1} alt="" />
				</div>
				<div className={styles.headerContent2}>
					{LEADING_ORGANIZATIONS_TITLE}
				</div>
				{/* <div
					className={styles.logosSection}
					// onMouseEnter={handleMouseEnter}
					// onMouseLeave={handleMouseLeave}
				>
					<div className={styles.imagesCarousel}>
						<Slider {...settings}>
					{Logos.map((ele) => {
						return (
							<div className={styles.imageSection2}>
								<img
									src={ele.image}
									alt=""
									// style={{opacity:hovered?ele.opacity:""}}
									// style={{opacity:ele.opacity}}
								/>
							</div>
						);
					})}
					</Slider>
					</div>
				</div> */}

				{/* images carousel */}
				<div className={styles.gridCarousel}>
					<Carousel cols={6} rows={2} gap={10} 
					 responsiveLayout={[
						{
						  breakpoint: 1440,
						  cols: 4,
						  gap:5
						},
						{
						  breakpoint: 768,
						  cols: 2
						}
					  ]}
					  mobileBreakpoint={670}
					  arrowRight={<ArrowBu type="right" />}
					  arrowLeft={<ArrowBtn type="left" />}
					loop>
						{Logos.map((ele, i) => {
							return (
								<Carousel.Item>
									<div
										className={
											styles.imageSection2
										}
									>
										<img src={ele.image} alt=""  />
									</div>
								</Carousel.Item>
							);
						})}
					</Carousel>
				</div>
				<div className={styles.carouselContent}>
					<img
						src={bgImage}
						alt=""
						className={styles.carouselBackground}
					/>

					<div className={styles.carouselContainer}>
						<Slider {...settings}>
							{carouselDataContent1.map((ele, i) => {
								return (
									<div className={styles.contains}>
										<img
											src={ele.image}
											alt=""
											className={
												styles.carouselImageSection
											}
										/>
										<div
											className={
												styles.carouselContentSection
											}
										>
											<div
												className={
													styles.carouselHeader
												}
											>
												{ele.header}
											</div>
											<div
												className={
													styles.carouselSubHeader
												}
											>
												{ele.subHeader}
											</div>
											<div
												className={
													styles.carouselParagraphContent
												}
											>
												{
													ele.paragraphContent
												}
											</div>
										</div>
									</div>
								);
							})}
						</Slider>
					</div>
				</div>
				<div id="features">
					<Features />
				</div>

				<div id="tools">
					<Tools />
				</div>
				<div id="pricing">
					<Pricing />
				</div>
			</div>
			<div className={styles.signupFormContent}>
				<div className={styles.headerContent4}>
					{HEADER_CONTENT_4}
				</div>
				<div className={styles.signUpForm} id="getStarted">
					<SignUpForm />
				</div>
			</div>
			<div id="help">
				<Footer />
			</div>
		</>
	);
}

export default LandingPage;
